import {useState,React} from 'react';
import axios from 'axios'
export const EmployeeAdd=()=>{
    const [formData,setFormData]=useState({});

    // const handleSubmit=async()=>{
    //     return await axios
    //     .get("http://localhost/8081/insert")

    // }
    const handleChange=(e)=>{
        const{name,value}=e.target;
        setFormData((formData)=>{
            return{...formData, [name]:value}
        })
    }
const placeholderValue=()=>{
 const name=formData.employeeType.value;
 return `Name of ${name}`;
}
    return(
        <section className='employee-add'>
        <div><span>Empolyee</span> </div>
        <div><p>Employee/Add new</p></div>
        <div>
        <h2>Employee information</h2>
        <form onSubmit={handleSubmit}> 
        <label for="employeeType">Employee type:</label><br/>
        <select id='employeeType' name='employeeType'>
            <option value='' selected='selected'>select type</option>
            <option value='Admin'>Admin</option>
            <option value='Manager'>Manager</option>
            <option value='Accountant'>Accountant</option>
            <option value='Instructor'>Instructor</option>
        </select><br/>
        <label for='fullName'>Full Name</label><br/>
        <input type='text' id='fullName' required value={formData.fullName} onChange={handleChange} name='fullName' placeholder={placeholderValue} autoComplete='off'/><br/>
        <label for='email'>Email</label><br/>
        <input type='email' id='email' required value={formData.email} onChange={handleChange} name='email' placeholder='Email' autoComplete='off'/><br/>
        <label for='phone'>Phone</label><br/>
        <input type='tel' id='phone' required value={formData.phone} onChange={handleChange} name='phone' placeholder='Phone Number' autoComplete='off'/><br/>
        <label for='salary'>Salary</label><br/>
        <input type='number' id='salary' required value={formData.salary} onChange={handleChange} name='salary' placeholder='Enter Salary' autoComplete='off'/><br/>
        <label for='date'>Employment date</label><br/>
        <input type='date' id='phone' required value={formData.date} onChange={handleChange} name='date' placeholder='' autoComplete='off'/><br/>
        <label for='course'>Course</label><br/>
        <select id='course' name='course[]' onChange={handleChange} multiple={true}>
            <option value='' selected='selected'>select course</option>
            <option value='graphic-design'>Graphic design</option>
            <option value='digital-marketing'>Digital marketing</option>
            <option value='photography'>Photography</option>
            <option value='animation'>Animation and motion design</option>
        </select><br/>
        <label for='regNum'>Registration No.</label><br/>
        <input type='text' id='regNum' required value={formData.regNum} name='regNum' placeholder='Registration no.' autoComplete='off'/><br/>
        <button type='submit' value={formData.submit} name='submit' onChange={handleSubmit}>Submit</button>
        </form>
        </div>

        </section>


    )
}
